import React from 'react'
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import example1 from '../assets/example1.jpg';
import example2 from '../assets/example2.jpg';

function Work() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  return (
    <Slider {...settings}>
        <div>
            <img className='h-36 mx-2 my-2' src={example1} alt="Example of work 1" />
        </div>
        <div>
            <img className='h-36 mx-2 my-2' src={example2} alt="Example of work 2" />
        </div>
    </Slider>
  )
}

export default Work
